import React from 'react';
import { FcGoogle } from 'react-icons/fc';
import { GoogleOAuthProvider } from '@react-oauth/google';
import { GoogleLogin } from '@react-oauth/google';

const GoogleLoginPage = () => {
  const responseGoogle = async (response) => {
    try {
      const { tokenId } = response;
      const googleToken = tokenId;

      const res = await fetch('/api/users/auth', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          googleToken,
        }),
      });

      if (res.ok) {
        const data = await res.json();
        console.log(data); // Handle the successful login response
      } else {
        throw new Error('Login failed');
      }
    } catch (error) {
      console.error(error);
      // Handle the login error
    }
  };

  const redirectUri = 'http://localhost:3000/api/auth/google/callback';

  return (
    <div className="">
      <div className="">
      <GoogleOAuthProvider clientId="317531692602-ttu1vjb449aliai0a0ifg2bs8ovm9p6i.apps.googleusercontent.com" redirectUri={redirectUri}>

          <GoogleLogin
            render={(renderProps) => (
              <button
                type="button"
                className=""
                onClick={renderProps.onClick}
                disabled={renderProps.disabled}
              >
                <FcGoogle className="" /> Logga in med Google
              </button>
            )}
            onSuccess={responseGoogle}
            onFailure={responseGoogle}
            cookiePolicy="single_host_origin"
          />
        </GoogleOAuthProvider>
      </div>
    </div>
  );
};

export default GoogleLoginPage;
